        </div>
        <div class="section2">
            <div class="open-door">
                <img
                    src="../../../../public/images/reg.png"
                    alt="reg"
                />
                <h3 class="title">Tag der offenen Türe in den Spielgruppen</h3>
                <div class="info">
                    <span class="label">Wann:</span>
                    <span class="value">{{ open_door_date }}</span>
                </div>
                <div class="info">
                    <span class="label">Zeit:</span>
                    <span class="value">{{ open_door_start_time }} bis
                        {{ open_door_end_time }} Uhr</span>
                </div>
                <div class="info">
                    <span class="label">Wo:</span>
