                                <NoIcon v-else />
                                <div
                                    class="letsplan-tooltip"
                                    @click.stop=""
                                    v-if="getOpeningHour(2, day)"
                                >
                                    <ExclametoryIcon />
                                    <div class="tooltip-text">
                                        <div class="info">
                                            <span class="label">Leiter/in:</span>
                                            <span class="value">
                                                {{
                                                        getOpeningHour(2, day).lead
                                                            .first_name
                                                }}

                                                {{
                                                        getOpeningHour(2, day).lead
                                                            .last_name
                                                }}
                                            </span>
                                        </div>

                                        <div class="info">
                                            <span class="label">Assistent/in:</span>
                                            <span class="value">
                                                {{
                                                        getOpeningHour(2, day)
                                                            .assistant.first_name
                                                }}

                                                {{
        getOpeningHour(2, day)
            .assistant.last_name
                                                }}
                                            </span>
                                        </div>
                                    </div>
