<script>
import axios from "../../axios";
import { mask } from "vue-the-mask";
import VueGoogleAutocomplete from "vue-google-autocomplete";
import phoneNumberFormater from "../../mixins/phoneNumberFormaterMixin";
import getLanguages from "../../mixins/getLanguagesMixin";
import getNationalities from "../../mixins/getNationalitiesMixin";
import DateInput from "../../shared/DateInput";
import flushMessagesMixin from "../../mixins/flushMessagesMixin";
import dayjs from "dayjs";
import isBetween from "dayjs/plugin/isBetween";
import customParseFormat from "dayjs/plugin/customParseFormat";

//Components
import TextInput from "./components/Form/TextInput.vue";
import SingleSelect from "./components/Form/SingleSelect.vue";
import SingleSelectWithSearch from "./components/Form/SingleSelectWithSearch.vue";
import PhoneNumber from "./components/Form/PhoneNumber.vue";
import SingleDate from "./components/Form/SingleDate.vue";
import Checkbox from "./components/Checkbox.vue";
import ConfirmationModal from "./components/ConfirmationModal.vue";
import PlaceInput from "./components/Form/PlaceInput.vue";
import FieldMissing from "./components/FieldMissing.vue";
import SingleDatePicker from "./SingleDatePicker.vue";

//Additional Libraries
import { useVuelidate } from "@vuelidate/core";
import { required, maxLength, helpers, email } from "@vuelidate/validators";
import YesIcon from "./components/Icons/YesIcon.vue";
import NoIcon from "./components/Icons/NoIcon.vue";
import ExclametoryIcon from "./components/Icons/ExclametoryIcon.vue";

dayjs.extend(isBetween);
dayjs.extend(customParseFormat);

export default {
    components: {
        VueGoogleAutocomplete,
        DateInput,
        TextInput,
        SingleSelect,
        PhoneNumber,
        SingleDate,
        Checkbox,
        ConfirmationModal,
        PlaceInput,
        FieldMissing,
        YesIcon,
        NoIcon,
        ExclametoryIcon,
        SingleDatePicker,
        SingleSelectWithSearch,
    },
    mixins: [
        phoneNumberFormater,
        getLanguages,
        getNationalities,
        flushMessagesMixin,
    ],
    directives: { mask },
    name: "ChildRegistration",

    setup() {
        const v$ = useVuelidate();
        return { v$ };
    },

    filters: {
        formatTimeRange(value) {
            if (value) {
                return value.replace(/-/g, " - ") + " Uhr";
            }
            return value;
        },
    },

    data() {
        return {
            children_minimum_age: null,
            parents_inform_date: null,
            start_year: null,
            start_month: null,
            end_year: null,
            end_month: null,
            registration_phase_to: null,
            registration_phase_from: null,
            open_door_date: null,
            open_door_start_time: null,
            open_door_end_time: null,
            place: null,
            registrationInterval: null,
            company_id: null,
            playgroup: null,
            nationalities: [],
            playgroups: [],
            morning_selection: [],
            evening_selection: [],
            errors: {},
            processing: false,
            form: {
                child_first_name: "",
                child_last_name: "",
                child_birthday: "",
                mother_first_name: "",
                mother_last_name: "",
                father_first_name: "",
                father_last_name: "",
                optional_address: "",
                street: "",
                postal_code: "",
                street_number: "",
                place: "",
                place_id: "",
                email: "",
                phone_number: "",
                phone_number_prefix: 41,
                mobile_phone_number: "",
                mobile_phone_number_prefix: 41,
                gender_id: "",
                nationality_id: "",
                spielgruppen_id: "",
                mother_tongue_id: "",
                semester_id: "",
                membership_id: "",
                note: "",
                morningOpeningHours: [],
                afternoonOpeningHours: [],
                session_id: 1,
                division_class: null,
                registration_conditions: null,
                confirmation_age: null,
                company_id: this.$route.params.company_id,
            },
        };
    },
    created() {
        this.getLanguages();
        this.getNationalities();
        this.company_id = parseInt(this.$route.params.company_id);
        setTimeout(() => {
            this.getSpielgruppen();
        }, 1000);
        this.getRegistrationPeriodInfo(this.company_id);
    },
    mounted() {
        this.registrationInterval = setInterval(
            () => this.getRegistrationPeriodInfo(this.company_id),
            5000
        );
    },
    watch: {
        morning_selection() {
            delete this.errors.openingHours;
            this.form.morningOpeningHours = [];
            this.morning_selection.forEach((item) => {
                this.form.morningOpeningHours.push({
                    [item]: 1,
                });
            });
        },

        evening_selection() {
            delete this.errors.openingHours;
            this.form.afternoonOpeningHours = [];
            this.evening_selection.forEach((item) => {
                this.form.afternoonOpeningHours.push({
                    [item]: 2,
                });
            });
        },

        "form.spielgruppen_id": function (value) {
            if (value !== "keine") {
                axios
                    .get(`/api/spielgruppen/get/with-available-slots/${value}`)
                    .then((res) => {
                        console.log("test", res.data);
                        this.playgroup = res.data;
                    });
            } else {
                this.playgroup = null;
            }
        },
    },
    methods: {
        isHourSelectable(day_id, hour_id) {
            console.log(this.playgroup)
            if (this.form.spielgruppen_id == 'keine') {
                return true;
            } else if (this.form.spielgruppen_id == '') {
                return false;
            } else if (this.form.spielgruppen_id && this.playgroup) {
                const openingHour = this.playgroup.opening_hours.find(item => item.hour_id == hour_id && item.day_id == day_id)
                return openingHour ? true : false;
            }
            return false;
        },
        clearSlots() {
            this.morning_selection = []
            this.evening_selection = []
        },

        setSingleDate(e) {
            this.form.child_birthday = e.start;
            delete this.errors.child_birthday;
        },
        checkLength(e, fieldName, count) {
            delete this.errors.street
            delete this.errors.place_id
            this.$refs.address.$el.classList.remove('error-box')
            if (e.target.value.length > count) {
                this.$refs.address.$el.style.border = "1px solid #E97D32";
                document.getElementById(fieldName + "_error").innerHTML = "Maximal " + count + " Zeichen möglich";
            } else {
                this.$refs.address.$el.style.border = "";
                document.getElementById(fieldName + "_error").innerHTML = "";
            }
        },
        getNewVal(newLocationAddres) {
            if (newLocationAddres == "") {
                this.form.street = "";
                this.form.street_number = "";
                this.form.postal_code = "";
                this.form.place_id = "";
                this.form.city = "";
            }
            this.$refs.address.$data.autocompleteText = this.form.street;
        },

        getFromAddress(from_address, placeResultData, id) {
            this.form.street = from_address.route;
            this.form.street_number = from_address.street_number;
            this.form.postal_code = from_address.postal_code;
            this.form.place = from_address.locality;
            this.form.place_id = placeResultData.place_id;
        },

        getOpeningHour(hour_id, day_id) {
            if (!this.playgroup) return null;

            return this.playgroup.opening_hours.find((item) => {
                return item.hour_id == hour_id && item.day_id == day_id;
            });
        },

        updateAddressInfoFromGoogleApi(address_info, placeResultData, id) {
            this.form.street = address_info.route;
            this.form.street_number = address_info.street_number;
            this.form.postal_code = address_info.postal_code;
            this.form.place = address_info.locality;
            this.form.place_id = placeResultData.place_id;
        },

        getSpielgruppen() {
            axios
                .get(`/api/spielgruppens/${this.company_id}?status=1`)
                .then((res) => {
                    res.data.splice(0, 0, { id: "keine", name: "Keine" });
                    this.playgroups = res.data;
                });
        },

        getDayName(id) {
            const days = [
                "Montag",
                "Dienstag",
                "Mittwoch",
                "Donnerstag",
                "Freitag",
            ];
            return days[id - 1];
        },

        getRegistrationPeriodInfo() {
            axios
                .get(`/api/get-period-info/${this.company_id}`)
                .then((res) => {
                    this.children_minimum_age = res.data.children_minimum_age;
                    this.parents_inform_date = res.data.parents_inform_date;

                    this.start_year = res.data.playgroup_phase_start_date_year;
                    this.end_year = res.data.playgroup_phase_end_date_year;

                    this.start_month =
                        res.data.playgroup_phase_start_date_month;
                    this.end_month = res.data.playgroup_phase_end_date_month;

                    this.registration_phase_to = res.data.registration_phase_to;
                    this.registration_phase_from =
                        res.data.registration_phase_from;

                    this.open_door_date = res.data.open_door_date;
                    this.open_door_start_time = res.data.open_door_start_time;
                    this.open_door_end_time = res.data.open_door_end_time;
                    this.place = res.data.place;

                    if (this.isOutOfRegistrationPeriod()) {
                        this.$router.push({
                            name: "out-of-registration-period",
                            params: {
                                registration_phase_start_date:
                                    res.data.upcoming_registration_start_date,
                                registration_phase_end_date:
                                    res.data.upcoming_registration_end_date,
                            },
                        });
                    }
                })
                .catch((err) => {
                    this.$router.push({
                        name: "child-registration-error",
                    });
                });
        },

        isOutOfRegistrationPeriod() {
            const start_date = dayjs(
                this.registration_phase_from,
                "DD.MM.YYYY"
            ).format("YYYY-MM-DD");
            const end_date = dayjs(
                this.registration_phase_to,
                "DD.MM.YYYY"
            ).format("YYYY-MM-DD");
            const now = dayjs().format("YYYY-MM-DD");

            if (now < start_date || now > end_date) {
                return true;
            }
            return false;
        },

        registerChild() {
            this.processing = true;
            if (this.isOutOfRegistrationPeriod()) {
                return this.$router.push({
                    name: "out-of-registration-period",
                    params: {
                        registration_phase_start_date:
                            this.registration_phase_from,
                        registration_phase_end_date: this.registration_phase_to,
                    },
                });
            }
            let hoursData = {};
            if (
                this.form.morningOpeningHours.length &&
                this.form.afternoonOpeningHours.length
            ) {
                hoursData = JSON.stringify(
                    this.form.morningOpeningHours.concat(
                        this.form.afternoonOpeningHours
                    )
                );
            } else if (this.form.morningOpeningHours.length) {
                hoursData = JSON.stringify(this.form.morningOpeningHours);
            } else if (this.form.afternoonOpeningHours.length) {
                hoursData = JSON.stringify(this.form.afternoonOpeningHours);
            } else {
                hoursData = "";
            }

            const intPhoneNumber = parseInt(
                this.form.phone_number
                    ? this.form.phone_number.replace(/ /g, "")
                    : ""
            );
            const intMobileNumber = parseInt(
                this.form.mobile_phone_number
                    ? this.form.mobile_phone_number.replace(/ /g, "")
                    : ""
            );

            let data = {
                ...this.form,
                ["phone_number"]: intPhoneNumber,
                ["mobile_phone_number"]: intMobileNumber,
                ["openingHours"]: hoursData,
            };

            axios
                .post(`/api/${this.company_id}/parent-registry`, data)
                .then((res) => {
                    return this.$router.push({
                        name: "confirmation-message",
                        params: {
                            parents_inform_date: this.parents_inform_date,
                        },
                    });
                })
                .catch((err) => {
                    const backend_errors = err.response.data.errors;
                    this.errors = backend_errors;
                    if (this.errors.hasOwnProperty('street') || this.errors.hasOwnProperty('place_id')) {
                        this.$refs.address.$el.classList.add('error-box')
                    }

                    let title = "Fehlende oder ungültige Pflichtangaben";
                    let description =
                        "Bitte füllen Sie alle erforderlichen Felder aus und/oder erfassen Sie für diese gültige Daten gemäss orangen Informationstexten.";

                    if (backend_errors.hasOwnProperty("invalid_playgroup")) {
                        title = undefined;
                        description =
                            "Leider hat es für die von Ihnen gewählte Spielgruppe für Ihre möglichen Halbtage und gewünschte Anzahl Spielgruppenbesuche pro Woche keinen Platz mehr. Bitte wählen Sie eine andere Spielgruppe aus oder wählen “Keine”. Bei “Keine” wird Ihr Kind in die möglichst naheliegendste Spielgruppe eingeteilt.";
                    }

                    EventBus.$emit("field-missing-modal:show", {
                        yesClick: () =>
                            EventBus.$emit("field-missing-modal:hide"),
                        title,
                        description,
                    });
                    if (err.response.status == 422) {
                        this.errors = err.response.data.errors;
                    }
                })
                .finally(() => (this.processing = false));
        },
    },

    validations() {
        return {
            form: {
                child_first_name: {
                    maxLength: helpers.withMessage(
                        "Maximal 30 Zeichen möglich",
                        maxLength(30)
                    ),
                },
                child_last_name: {
                    maxLength: helpers.withMessage(
                        "Maximal 30 Zeichen möglich",
                        maxLength(30)
                    ),
                },
                father_first_name: {
                    maxLength: helpers.withMessage(
                        "Maximal 30 Zeichen möglich",
                        maxLength(30)
                    ),
                },
                father_last_name: {
                    maxLength: helpers.withMessage(
                        "Maximal 30 Zeichen möglich",
                        maxLength(30)
                    ),
                },
                mother_first_name: {
                    maxLength: helpers.withMessage(
                        "Maximal 30 Zeichen möglich",
                        maxLength(30)
                    ),
                },
                mother_last_name: {
                    maxLength: helpers.withMessage(
                        "Maximal 30 Zeichen möglich",
                        maxLength(30)
                    ),
                },
                optional_address: {
                    maxLength: helpers.withMessage(
                        "Maximal 30 Zeichen möglich",
                        maxLength(30)
                    ),
                },
                street: {
                    maxLength: helpers.withMessage(
                        "Maximal 30 Zeichen möglich",
                        maxLength(30)
                    ),
                },
                street_number: {
                    maxLength: helpers.withMessage(
                        "Maximal 30 Zeichen möglich",
                        maxLength(30)
                    ),
                },
                postal_code: {
                    maxLength: helpers.withMessage(
                        "Maximal 10 Zeichen möglich",
                        maxLength(10)
                    ),
                },
                place: {
                    maxLength: helpers.withMessage(
                        "Maximal 30 Zeichen möglich",
                        maxLength(30)
                    ),
                },
                email: {
                    email: helpers.withMessage(
                        "Ungültiges E-Mail Format",
                        email
                    ),
                },
            },
        };
    },

    beforeDestroy() {
        clearInterval(this.registrationInterval);
    },
};
</script>

